import React from 'react'
import PropTypes from 'prop-types'
export default function Navbar(props) {
  return (
    <>
    {/* bg-body-tertiary  */}
      <nav className Name={`navbar navbar-expand-lg navbar-${props.mode} bg-${props.mode}`}>
      <div className Name="container-fluid">
      <a className Name="navbar-brand" href="/">{props.title}</a>
      <button className Name="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span className Name="navbar-toggler-icon"></span>
      </button>
      <div className Name="collapse navbar-collapse" id="navbarSupportedContent">
      <ul className Name="navbar-nav me-auto mb-2 mb-lg-0">
      <li className Name="nav-item">
      <a className Name="nav-link active" aria-current="page" href="/">Home</a>
      </li>
      <li className Name="nav-item">
      <a className Name="nav-link" href="/">{props.aboutText}</a>
      </li> 
      </ul>
      {/* <form className Name="d-flex" role="search">
      <input className Name="form-control me-2" type="search" placeholder="Search" aria-label="Search"/>
      <button className Name="btn btn-outline-primary" type="submit">Search</button>
      </form> */}
      <div className ={`form-check form-switch text-light`}>
        <input className ="form-check-input" type="checkbox" role="switch" id="flexSwitchCheckDefault"/>
        <label className ="form-check-label" for="flexSwitchCheckDefault">Enable Dark Mode</label>
      </div>
      </div>
      </div>
      </nav>
    </>
  )
}
    Navbar.propTypes = {title: PropTypes.string.isRequired,
    aboutText: PropTypes.string
} 
